import React, { Fragment, useEffect } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './component/Sub-Admin/layout/navebar';
import Landing from './component/layout/landing';
import SubAdminLogin from './component/Sub-Admin/auth/Login';
import SubAdminRegister from './component/Sub-Admin/auth/Register';
import Alert from './component/layout/Alert';
import { loadSubAdmin } from './actions/Sub-Admin/auth';
import setAuthToken from './utils/setAuthToken';
import Dashboard from './component/Sub-Admin/dashboard/Dashboard';
import PrivateRoute from './component/Sub-Admin/routing/PrivateRoute';
import Owners from './component/Sub-Admin/Owner/Owners';
import Customers from './component/Sub-Admin/Customer/Customer';
import Vehicle from './component/Sub-Admin/Vehicle/Vehicle';
import Report from './component/Sub-Admin/Reports/Report';
import Booking from './component/Sub-Admin/Owner/Bookings';
import OwnerById from './component/Sub-Admin/Owner/OwnerById';
import CustomerById from './component/Sub-Admin/Customer/CustomerById';
import VehicleById from './component/Sub-Admin/Vehicle/VehicleById';
import 'bootstrap/dist/css/bootstrap.min.css';

//redux

import { Provider } from 'react-redux';
import store from './store';

import './App.css';

if (localStorage.token) {
  setAuthToken(localStorage.token);
}

const App = () => {
  useEffect(() => {
    store.dispatch(loadSubAdmin());
  }, []);

  return (
    <Provider store={store}>
      <Router>
        <Fragment>
          <Navbar />
          <Route exact path='/' component={Landing} />

          <section className='container'>
            <Switch>
              <Route
                exact
                path='/SubAdminRegister'
                component={SubAdminRegister}
              />
              <Route exact path='/SubAdminLogin' component={SubAdminLogin} />
              <Route exact path='/owners' component={Owners} />
              <Route exact path='/customer' component={Customers} />
              <Route exact path='/vehicle' component={Vehicle} />
              <Route exact path='/reports' component={Report} />
              <Route exact path='/OwnerById/:id' component={OwnerById} />
              <Route exact path='/CustomerById/:id' component={CustomerById} />
              <Route exact path='/VehicleById/:id' component={VehicleById} />
              <Route exact path='/Bookings/:id' component={Booking} />
              <PrivateRoute exact path='/dashboard' component={Dashboard} />
            </Switch>
            <Alert />
          </section>
        </Fragment>
      </Router>
    </Provider>
  );
};

